        function parseRoc(str){
          if (typeof str === 'string'){

            if (str!==''&&str!==null&&str!==undefined){

              let currentStr;
              let type;
              let data;
              if ((str.indexOf('<RocCurve>')!==-1)&&(str.indexOf('<RocCurve/>')!==-1)){

